                    Calculated BMI: <div ID="BMI"></div>
<script src="includes/jmesa/jquery.min.js">// for OC versions before 3.1.4, use jquery-1.3.2.min.js !</script>
<script>
$.noConflict();
jQuery(document).ready(function($) { 
var heightField = $("#Height").parent().parent().find("input");
var weightField = $("#Weight").parent().parent().find("input");
var bmiField = $("#BMI").parent().parent().find("input");
var unitField = $("#Units").parent().parent().find("input");

function getBMI(height1, weight1, unit1){
 //calculate weight portion
 var weightLBS = weight1*703;
var weightKG = weight1;
 //calculate height portion
 var heightINCH = height1*height1;
var heightM = (height1/100);
 var heightMSQ = (heightM*heightM);
 //divide weight by height
 var bmi1 = (weightLBS/heightINCH);
var bmi2 = (weightKG/heightMSQ);
 //calculate the days
 var finalBMI1 = Math.round(bmi1*10)/10;
var finalBMI2 = Math.round(bmi2*10)/10;

if(unit1[0].checked)
{ if(isNaN(finalBMI1)){ return 0; }
  else{ return finalBMI1; }
}
else if(unit1[1].checked)
{ if(isNaN(finalBMI2)){ return 0; }
  else{ return finalBMI2; }}
else
{ return 0;
}
}

function calcBMI()
{
 //calculate the BMI given the height and weight.
 var bmi = getBMI(heightField.val(), weightField.val(),unitField);
 //write the calculated value to the field.
 if (bmiField.val() != bmi){
  bmiField.val(bmi);
  bmiField.change();
 }
};
//Calculate will fire upon save or when the calculation button is clicked.
$("#srl").focus(function(){ calcBMI(); });
$("#srh").focus(function(){ calcBMI(); });
$("#calculate1").click(function(){ calcBMI(); });
})
</script>  - <img id="calculate1" src="images/bt_Portal.gif">
<script src="includes/jmesa/jquery-1.3.2.min.js"></script>
<script lang="Javascript">
$.noConflict();
</script>

